script: |
  super -f text -I q556.spq | sort > q556.out

inputs:
  - name: q556.spq
    data: |
      SELECT ALL - 55 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col2 BETWEEN - CAST ( NULL AS INTEGER ) AND - col2 * + 61;
  - name: tab2

outputs:
  - name: q556.out
    data: |
      -55
      -55
      -55
